import React from "react";
import AddtradeComponent from "./addtradeComponent";

class Addtrade extends React.Component {
  state = {
    disabled: false,
    buyingParty: {
      value: "",
      valid: "",
      help: ""
    },
    sellingParty: {
      value: "",
      valid: "",
      help: ""
    },
    productStock: {
      value: "",
      valid: "",
      help: ""
    },
    productName: {
      value: ""
    },
    quantity: {
      value: "",
      valid: "",
      help: ""
    },
    notionalCurrency: {
      value: ""
    },
    underlyingCurrency: {
      value: ""
    },
    strikePrice: {
      value: "",
      valid: "",
      help: ""
    },
    expiryDate: {
      value: ""
    },
    expiryTime: {
      value: ""
    },
    currencylist: ["KYD", "USD", "GBP"],
    companylist: ["Tesla", "Apple", "eBay", "Alibaba"],
    productlist: ["Car", "Oil", "Gun", "Gold"]
  };

  enableField = () => {
    this.setState({
      disabled: false
    });
  };

  disableField = () => {
    this.setState({
      disabled: true
    });
  };
  handleNumber = event => {
    event.preventDefault();
    const { name, value } = event.target;
    var validator = "validating";
    var helpMsg = "";
    console.log(`handling ${name} set to ${value}`);
    if (name === "quantity" || name === "strikePrice") {
      if (!Number(value) & (value !== "") || Number(value) < 0) {
        validator = "error";
        helpMsg =
          name === "quantity"
            ? "Enter a valid quantity"
            : "Enter a valid strike price";
      }
    }
    this.setState(prevState => ({
      // must take into account previous state as is an object with changing properties
      ...prevState, //Spread notation means to copy all same properties of previous states object "errors"
      [name]: {
        value: value,
        valid: validator,
        help: helpMsg
      }
    }));
  };
  handleBuyer = value => {
    var validator = "";
    var helpMsg = "";
    console.log(
      `Checking if ${value} is equal to ${this.state.sellingParty.value}`
    );
    if (value == this.state.sellingParty.value) {
      validator = "error";
      helpMsg = "Enter a valid buyer";
    }
    this.setState(prevState => ({
      ...prevState,
      buyingParty: {
        value: value,
        valid: validator,
        help: helpMsg
      }
    }));
  };
  handleSeller = value => {
    var validator = "";
    var helpMsg = "";
    console.log(
      `Checking if ${value} is equal to ${this.state.buyingParty.value}`
    );
    if (value == this.state.buyingParty.value) {
      validator = "error";
      helpMsg = "Enter a valid seller";
    }
    this.setState(prevState => ({
      ...prevState,
      sellingParty: {
        value: value,
        valid: validator,
        help: helpMsg
      }
    }));
  };

  handleNotional = v => {
    console.log(console.log(`selected notional ${v}`));
    this.setState(prevState => ({
      ...prevState,
      notionalCurrency: {
        value: v
      }
    }));
  };

  handleDropdown = val => {
    this.setState(prevState => ({
      ...prevState,
      productName: {
        value: val
      }
    }));
  };

  handleUnderlying = v => {
    console.log(console.log(`selected underlying ${v}`));
    this.setState(prevState => ({
      ...prevState,
      underlyingCurrency: {
        value: v,
        valid: "",
        help: ""
      }
    }));
  };

  handleExpirydate = (d, ds) => {
    this.setState(prevState => ({
      ...prevState,
      expiryDate: {
        value: ds
      }
    }));
  };

  handleExpirytime = (d, ds) => {
    this.setState(prevState => ({
      ...prevState,
      expiryTime: {
        value: ds
      }
    }));
  };

  handleVerify = () => {
    // fetch current prices, filling out a state variable which is then read as value from market value and notional value
  };

  render() {
    return (
      <AddtradeComponent
        handleNotional={this.handleNotional}
        handleNumber={this.handleNumber}
        handleBuyer={this.handleBuyer}
        handleSeller={this.handleSeller}
        handleUnderlying={this.handleUnderlying}
        handleDropdown={this.handleDropdown}
        handleExpirydate={this.handleExpirydate}
        handleExpirytime={this.handleExpirytime}
        handleVerify={this.handleVerify}
        enableField={this.enableField}
        disableField={this.disableField}
        data={this.state}
      />
    );
  }
}
export default Addtrade;
